// export default Card;
import React from 'react';
const getStyles = () => {
  return {
      display: "grid",
      gridTemplateColumns: "repeat(3, 1fr)",
      gridTemplateRows: "repeat(2, minmax(200px, 1fr))",
      gridGap: "16px",
      justifyContent: "center",
      alignItems: "center"
  }
}

const Card = (props) => {
  return (
    <div className="card-container" style={getStyles()}>
      <div className="card" >
        <img src={props.imagelink} className="card-img-top" alt="..." />
        <div className="card-body">
          <h5 className="card-title">{props.head}</h5>
          <p className="card-text">
           {props.info}
          </p>
          <a href={props.link} className="btn btn-primary">More info</a>
        </div>
      </div>
    </div>
  )
}

export default Card;
